INSERT INTO `detail_facility` VALUES (1,NULL,NULL,NULL,'가족들과 같이 족구를 즐길수 있습니다.','바베큐 이용요금(숯+그릴)은 2인 기준 10,000원, 4인이상 20,000원 입니다. 우천시에도 바베큐를 해드실 수 있는 공간이 있습니다. 객실 앞마다 바베큐를 해드실 수 있는 공간이 있습니다. 바베큐 이용요금은 펜션에서 납부하시기 바랍니다.',NULL,NULL,NULL,NULL,'자전거 무료대여 가능합니다.',NULL,NULL),(2,'팬션외부에 수영장이 있습니다.','수영장안에 미끄럼틀 시설 있습니다.',NULL,'족구 가능합니다.','바베큐 이용요금(숯+그릴)은 2인 기준 15,000원 입니다. 동절기, 우천시 사용 가능한 실외바베큐장이 있습니다.','캠프파이어 가능합니다.','펜션에서 차로 약 3분 거리에 노래방이 있습니다.',NULL,'세미나실(갤러리객실)이 있습니다. 최대 30명 수용 가능합니다. 갤러리객실 예약 고객은 그냥 이용 가능하며  그 외 객실 이용 고객님은 갤러리객실이 비었을 경우 이용 가능하므로 미리 이용 가능여부를 확인하여주시기 바랍니다. 세미나실 이용요금은 1시간 기준 50,000원 입니다. (갤러리객실 이용 고객 무료 이용) 빔프로젝트 준비되어 있습니다. 예약완료시 핸드폰으로 펜션관리자 연락처가 전송됩니다.  세미나실예약은 펜션관리자와 상의하시면 됩니다.',NULL,'4륜 오토바이 대여가능합니다.','서바이벌장이 마련되어 있습니다.'),(3,NULL,NULL,'축구장도 있습니다.',NULL,'바베큐 이용요금(숯+그릴)은 2인 기준 10,000원 4인 기준 20,000원입니다.  바베큐를 해드실 수 있는 개별바베큐장이 있습니다.  바베큐를 해드실 수 있는 야외 바베큐장이 있습니다.',NULL,'펜션에서 도보로 약 1~2분 거리에 노래방이 있습니다.','팬션앞에 농구장이 있습니다.',NULL,'자전거 대여 가능합니다.',NULL,NULL),(4,'입실 후 부터 이용가능합니다. 2015년개장일정 : 6월부터 9월11일까지 이용가능하며  수영장 폐장일은 펜션사정이나 날씨에의해 조정될 수 있습니다. 수영복, 수영모 착용하여 이용가능하며 부득이한경우 야구모자, 비치웨어복장으로도 이용가능합니다. 수영장은 가로 22m x 세로 11m x 깊이 1.2m 정도입니다.',NULL,NULL,NULL,NULL,NULL,NULL,'농구장이 있습니다.',NULL,'펜션 바로 앞에 북한강을 따라 자전거 도로가 설치되어 있습니다. 자전거 유료 대여 가능합니다. (1시간 5,000원)',NULL,NULL);
