INSERT INTO `detail_structure` VALUES (1,'나뚜루실은 복층구조로 되어있습니다.','그린토마토실은 독채로 되어있습니다.','스파이용 가능합니다.',NULL),(2,NULL,NULL,NULL,'제일 윗층에서 테라스 바베큐가 가능합니다.'),(3,'2층의 전객실은 복층으로 되어있습니다.',NULL,NULL,NULL),(4,NULL,NULL,'수질속에 유황성분이 있어 특유의 냄새가 있고 씻고나면 피부가 굉장히 매끄러움을 느끼실수 있습니다.',NULL);
