INSERT INTO `detail_support` VALUES (1,'도보로 3분거리에 편의점이 있습니다.',NULL,'죄송하지만 애완견은 데리고 오실수 없습니다.',NULL,'보드게임 대여 가능합니다.','가평터미널 인근 조은마트 , 플러스마트, 농수산마트에서 픽업 요청 후 장을 보시면 펜션까지 입실 픽업 가능합니다.  (조은마트 픽업시간 : 19시까지 / 플러스마트 픽업시간 : 주중 19시30분까지, 주말 20시30분까지) 여행시 필요한 물품을 다른곳에서 구매하지 않고 픽업 받으시는 마트에서 모두 구매하셔야 픽업 가능합니다.(1인기준 15,000원 정도) 가평터미널에서 펜션까지의 거리는 약 12km, 목동터미널에서 펜션까지는 약 3km 입니다.','KT올레 TV 설치되어 있습니다. 객실마다 인터넷라인이 제공되어 노트북을 가져오시면 인터넷을 사용하실 수 있습니다.',NULL,NULL,NULL),(2,'펜션에서 차로 약 3분 거리에 농협하나로마트가 있습니다.','펜션 인근에 식당이 있습니다. 식사는 준비되지 않으니 음식은 따로 준비하셔야 합니다.',NULL,NULL,NULL,'픽업이 불가합니다. 용문터미널에서 펜션까지의 거리는 약 30km 입니다. 예약완료시 핸드폰으로 펜션관리자 연락처가 전송됩니다. 찾아가는길은 펜션관리자와 상의하시면 됩니다.','객실마다 인터넷라인이 제공되어 노트북을 가져오시면 인터넷을 사용하실 수 있습니다.',NULL,NULL,'인근역에서 셔틀버스 운행합니다.'),(3,'펜션에서 차로 10분 거리에 마트가 있습니다.  마트가 펜션주변에 없으므로 교동 부근 마트에서 미리 장을 보시기 바랍니다.',NULL,NULL,'여럿이서 파티가능합니다.',NULL,'픽업이 불가합니다.  강릉시외버스터미널에서 펜션까지의 거리는 약 5km 입니다.  예약완료시 핸드폰으로 펜션관리자 연락처가 전송됩니다. 찾아가는길은 펜션관리자와 상의하시면 됩니다.',NULL,NULL,'스타벅스가 가까운곳에 있습니다.',NULL),(4,'펜션에서 차로 3분 거리에 매점이 있습니다.','아침식사 제공합니다.',NULL,NULL,'보드게임 대여가능합니다.','굴봉산역에서 왕복픽업이 가능합니다. 예약완료시 핸드폰으로 펜션관리자 연락처가 전송됩니다.  찾아가는길 및 픽업장소와 픽업시간은 펜션관리자와 상의하시면 됩니다.','객실에 쿡티비가 설치되어 있어 TV시청이 가능합니다. 전객실에 와이파이(무선인터넷)가 설치되어있어 노트북을 가져오시면 인터넷사용이 가능합니다.',NULL,NULL,NULL);
