INSERT INTO `pension` VALUES (1,'가평 제이스펜션','경기도','가평군','북면 제령리 515-1번지','02-813-0960',111,'국민 448601-01-509071 유휴','푸른 자연이 살아 숨쉬는 곳!!   경기도 가평에 위치한 제이스펜션에 오신 모든 분들을 환영합니다. 제이스펜션은 맑은 계곡이 흐르고 시원하고 상쾌한 공기를 마실 수 있는 곳으로 편안하고 아늑하게 여행에서의 휴식을 취할 수 있어 연인, 가족이 이용하기에 좋습니다.   기분좋은 여행의 편안한 휴식처가 되겠습니다. 제이스펜션에서 즐거운 시간 보내세요. 감사합니다.','P001_F01.jpg|P001_F02.jpg','네비게이션 이용시 : 경기도 가평군 북면 제령리 515-1번지   자가용이용시 ◎ 올림픽대로 이용시  올림픽대로-팔당 대교(우회전) => 팔당 터널지나 500m 진행 => 조안 IC (청평/춘천/가평방면) => 금남리 => 새터삼거리 => 대성리 => 청평 => 빗고개 => 가평 진입전 철다리 지나면서 좌회전(명지산/연인산방면) => 가평군청(큰 느티나무있음) => 북면,목동방면으로 약8km쯤 직진 => 북면.목동삼거리에서 좌측 명지산.적목리방향으로 좌회전 => 약 2.5km쯤 아모르 이정표가 보이면 좌측으로 진입후 다리건너기 => 다리건너서 우회전후 조금만 올라오시면 => \"제이스 펜션\" ◎ 강변북로  강변북로 => 남양주 문화체육관앞 지나 => 경춘국도쪽으로(우회전) => 도농삼거리 (약간 좌회전/춘천 방향) => 평내 => 마석 => 대성리진입 => 대성리 => 청평 => 빗고개 =>가평 진입전 철다리 지나면서 좌회전(명지산/연인산방면) =>가평군청(큰 느티나무있음) => 북면,목동방면으로 약8km쯤 직진 => 북면.목동삼거리에서 좌측 명지산.적목리방향으로 좌회전 => 약 2.5km쯤 아모르 이정표가 보이면 좌측으로 진입후 다리건너기 => 다리건너서 우회전후 조금만 올라오시면 =>\"제이스 펜션\" ◎ 자유로.내부순환로  자유로/내부순환도로 => 성산대교분기점(내부순환도로이용) => 상암 => 정릉터널 => 길음램프(마장동/동부간선도로) => 동부간선도로 => 신내동 분기점 => 중부고속도로로 빠짐(4km진행) => 퇴계IC => 일동/포천방향으로 2.5km 진행 => 진관IC => 호평, 마석, 춘천. 청평 방면으로 빠짐 => 자동차전용도로 => 평내=> 마석=> 대성리진입 => 대성리 => 청평 => 빗고개 =>가평 진입전 철다리 지나면서 좌회전(명지산/연인산방면) =>가평군청(큰 느티나무있음) => 북면,목동방면으로 약8km쯤 직진 => 북면.목동삼거리에서 좌측 명지산.적목리방향으로 좌회전 => 약 2.5km쯤 아모르 이정표가 보이면 좌측으로 진입후 다리건너기 => 다리건너서 우회전후 조금만 올라오시면 => \"제이스 펜션\" ◎ 중부고속도로/경부고속도로 (구리.평내.마석.청평경유)  중부고속도로/경부고속도로=> 판교/구리 =>퇴계IC(일동방향) => 퇴계IC =>일동/포천방향으로 2.5km 진행 =>진관IC =>호평, 마석, 춘천. 청평 방면으로 빠짐 => 자동차전용도로 => 평내 => 마석 => 새터삼거리(고가도로에서청평,춘천 방면 빠짐) =>대성리 => 청평 => 빗고개 =>가평 진입전 철다리 지나면서 좌회전(명지산/연인산방면) =>가평군청(큰 느티나무있음) => 북면,목동방면으로 약8km쯤 직진 => 북면.목동삼거리에서 좌측 명지산.적목리방향으로 좌회전 => 약 2.5km쯤 아모르 이정표가 보이면 좌측으로 진입후 다리건너기 => 다리건너서 우회전후 조금만 올라오시면 => \"제이스 펜션\" ◎ 중부고속도로/경부고속도로(장현.광릉.내촌경유)  중부고속도로/경부고속도로 => 판교/구리-퇴계IC(일동방향) => 퇴계IC에서 진건 삼거리(의정부, 포천 방면) 빠짐 =>진건삼거리(47번국도 이용) => 광릉내 일동방면 => 장현 => 광릉내(베어스타운스키장) => 내촌 =>신팔IC에서 청평,가평,춘천 방면으로 빠짐 => 대성리 => 청평 => 빗고개 =>가평 진입전 철다리 지나면서 좌회전(명지산/연인산방면) =>가평군청(큰 느티나무있음) => 북면,목동방면으로 약8km쯤 직진 => 북면.목동삼거리에서 좌측 명지산.적목리방향으로 좌회전 => 약 2.5km쯤 아모르 이정표가 보이면 좌측으로 진입후 다리건너기 => 다리건너서 우회전후 조금만 올라오시면 => \"제이스 펜션\" ◎ 중앙고속도로(춘천)  춘천=> 경춘국도=> 강촌검문소 => 경강대교 => 가평대교 => 가평오거리에서 가평읍으로 진입 => 가평버스터미널앞길로 북면.명지산쪽으로 직진 => 북면,목동방면으로 약8km쯤 직진 => 북면.목동삼거리에서 좌측 명지산.적목리방향으로 좌회전 => 약 2.5km쯤 아모르 이정표가 보이면 좌측으로 진입후 다리건너기 => 다리건너서 우회전후 조금만 올라오시면 =>\"제이스 펜션\"  기차이용시 1. 청량리나 성북역에서 가평행 기차를 타시고 가평역에서 하차하세요.  2. 가평역에서 하차후 도보로 3분거리인 가평버스터미널로 이동하세요.  3. 가평버스터미널에서 북면 적목리.백둔리 행을 타시고 제령리 홍운 교회 수양관 앞에서 하차하세요. 4. 제령리 마을회관 들어오는 다리를 건너서 오른쪽으로 조금만 올라오시면 \"제이스펜션\"이 있습니다.   버스이용시 1. 청량리 현대코아앞에서 꼭가평.목동행 1330번을 타시고 목동종점에서 하차하시면 됩니다.  2. 동서울버스터미널이나 상봉버스터미널에서 가평행 버스를 타시고 가평에서 하차하세요.  3. 북면 적목리.백둔리 행을 타시고 제령리 홍운 교회 수양관 앞에서 하차하세요.  4. 제령리 마을회관 들어오는 다리를 건너서 오른쪽으로 조금만 올라오시면 \"제이스펜션\"이 있습니다.',37.8973831,127.5240158),(2,'퀸스타운펜션','경기도','양평군','단월면 석산리 150-4','02-813-0960',111,'국민 448601-01-509071 유휴','About QUEENS TOWN 퀸스타운 펜션은?   안녕하세요? 물맑고 경치좋은 경기도 양평군 단월면에 위치하고 있는 퀸스타운에 오심을 환영합니다. 바쁜 일상속에서 편히 쉬어 갈 수 있는 퀸스타운 펜션....   물이 흐르는 강가를 배경으로 소리산을 바라보며 아침에 새소리를 들으며 커텐을 여는 느낌을 퀸스타운에서 느껴 보세요. 가족,친구,커플과 여행이라면 퀸스타운펜션으로 여러분을 초대합니다.   퀸스타운 펜션올림.','P002_F01.jpg|P002_F02.jpg','자가용이용시 서울 - 춘천고속도로 이용시 1. 고속도로진입(서울) 설악I.C - 홍천/대명비발디파크 방향 - 설악면 - 모곡리 - 퀸스타운 2. 고속도로진입(서울) 강촌I.C - 홍천/대명비발디파크 방향 - 마곡리 - 모곡리 - 퀸스타운   서울방면 올림픽대로 - 중부고속도로 - 하남I.C - 팔당대교 - 양수리 - 양평시내진입 전 삼거리(좌회전) - 홍천횡성방향 좌회전 - 용문터널 용문사 입구 - 검문소 - 서면비발디파크 또는 고로쇠마을 - 석산리 - 퀸스타운   서울, 대성리방면 구리 - 청평 - 신청평대교 - 팔당대교 - 설악면 - 모곡 - 퀸스타운   대구, 부산방면 금호I.C - 중앙고속도로 - 안동 - 원주 - 홍천I.C 44번국도(서울,양평 방향) - 며느리고개터널 - 양덕원 - 춘천/가평 비발디파크방향 - 청평목곡방향 - 퀸스타운   광주, 대전방향 호남고속도로 - 회덕J.C - 경부고속도로 - 남이J.C - 중부고속도로 - 호법J.C - 영동고속도로 - 이천J.C - 이천시내 - 이포 - 이포대교 건너서 지평 - 용문 - 용문터널 - 서면 비발디파크 또는 고로쇠마을 - 석산리 - 퀸스타운   춘천방면 중앙고속도로 - 홍천I.C 44번국도(서울,양평 방향) - 며느리고개터널 - 양덕원 - 춘천/가평 비발디파크방향 - 청평목곡방향 - 퀸스타운   대중교통이용시 시외버스 이용시 출발 : 상봉터미널 / 도착 : 단월터미널 / 운행시간 : AM 5:50 → PM 9:20 / 소요시간 : 1시간 10분 출발 : 동서울터미널 / 도착 : 단월터미널 / 운행시간 : AM 6:15 → PM 9:50 / 소요시간 : 1시간 10분   기차 이용시 출발 : 청량리 / 도착 : 용문방향 출발 6:00 / 7:00 / 8:00 / 9:00 / 10:30 / 12:00 / 13:00 / 14:00 / 15:00 / 16:00 / 17:00 / 18:00 / 19:00 / 20:00 / 21:00 / 21:50 / 22:40 도착 7:01 / 8:03 / 9:01 / 9:59 / 11:36 / 13:02 / 13:59 / 15:07 / 16:01 / 17:01 / 18:04 / 19:02 / 20:09 / 21:08 / 22:00 / 22:52 / 23:42   출발 : 용문 / 도착 : 청량리방향 출발 5:10 / 7:01 / 8:36 / 10:09 / 10:27 / 11:47 / 12:34 / 13:46 / 14:30 / 15:47 / 16:48 / 18:34 19:43 / 20:30 / 21:36 / 22:00 도착 6:09 / 8:08 / 9:39 / 11:10 / 11:25 / 12:48 / 13:48 / 14:46 / 15:32 / 16:50 / 17:48 / 19:38 20:41 / 21:31 / 22:38 / 22:59   상봉터미널 02-435-2122 동서울터미널 02-446-8000 홍천터미널 033-434-3699 청량리기차역 02-3299-7212 용문역 1544-7788 / 1588-7788',37.6463947,127.6154361),(3,'다올펜션','강원도','강릉시','저동 673-9','02-813-0960',111,'국민 448601-01-509071 유휴','너랑 나만 아는 비밀스런 사랑이야기 안녕하세요. 다올지기입니다.   전객실에서 경포호를 바라보며 최고급 스파를! 에메랄드빛 경포해변과 항금빛 모래사장.. 관동팔경의 대표적 명소 경포대에 위치한 깨끗하고 품격있는 펜션으로 당신을 초대합니다. 아름다운 자연경관이 펼쳐진 다올펜션에서 소중한 인연과 특별한 추억을 만드세요.   경포대를 비추던 다섯개의 달 처럼   다올과 함께 다섯가지 사랑이야기를 그려보세요.','P003_F01.jpg|P003_F02.jpg','자가용이용시 고속도로이용 영동고속도로 강릉I.C에서 \"강릉\"방면으로 우측 고속도로 출구 → 동해고속도로 → 강릉 톨게이트 → 강릉I.C에서 \"동해·강릉\"방면으로 좌측 → \'주문진, 경포, 강릉과학산업단지\'방면으로 우측방향으로 사임당로 2.25km 이동 → \'솔올지구, 강릉원주대학교\' 방면으로 우회전 → 솔올교차로에서 \'양양, 주문진\' 방면으로 좌회전 → \'경포, 참소리박물관, 강릉선교장, 동해, 정동진, 오죽헌, 박물관\' 방면으로 우회전 → \'경포, 참소리박물관, 강릉선교장\' 방면으로 좌측방향 → 운정삼거리에서 \'경포\' 방면으로 좌회전 → 경포대 → 다올펜션   네비게이션 주소검색 : 강원도 강릉시 저동골길 7 다올펜션   대중교통이용시 버스편 고속버스터미널이용 01_ 동서울종합터미널(1688-5979) → 강릉 터미널 도착 02_ 서울고속버스터미널(02-535-4151) → 강릉 터미널 도착 03_ 서울남부터미널(02-521-8550) → 강릉 도착   기차편 기차이용 01_기차표예매(1544-7788) 출발지 → 강릉역',37.7981294,128.8925034),(4,'N.E PARK 엔이파크','강원도','춘천시','남산면 서천리 20-1번지','02-813-0960',111,'국민 448601-01-509071 유휴','심플함과 모던함을 지향하는 리조트식 스타일의 N.E.PARK 강이 보이는 탁트인 전망, 편안하고 안락한 객실, 수준급 실력의 주방장이 선보이는 요리, 유황수 목욕과 각종 편의시설까지.. 저희 N.E.PARK는 고객에게 세심한 서비스를 제공하고 특별한 가치를 만들어 나가도록 최선을 다하겠습니다.','P004_F01.jpg|P004_F02.jpg','자가용이용시   *네비게이션 주소 강원도 춘천시 남산면 서천리 20-1번지   1. 국도이용시 (서울에서 오실때) 46번 국도 타고 가평 지나 가평 제2교, 경강대교를 지나 3km 직진 후 엘리시안 이정표를 보고 우측으로 빠집니다. 약 500m 쯤 가서 삼거리가 나오면 좌회전 후 또 삼거리가 나오면 우회전해서 조금만 오시면 우측에 N.E.PARK가 보입니다.   2. 춘천고속도로 이용시 (서울에서 오실때) 강촌IC로 나와 강촌이정표를 보고 약 15~20분 정도 옵니다. 강촌시내 삼거리에서 엘리시안 이정표를 보고 우회전 후 바로 좌회전해서 약 5분 정도 직진하시면 엘리시안 나오고 또 5분정도 가시면 촤측으로 N.E.PARK가 보입니다.',37.8420013,127.5573622);
